// File contracts/rel/RELToken.sol

pragma solidity ^0.8.0;

contract RelationToken is ERC20 {
    uint256 public constant TOTAL_SUPPLY = 1_000_000_000 * 10**18;

    constructor(
        address receiver
    ) ERC20("Relation Token", "REL") {
        _mint(receiver, TOTAL_SUPPLY);
    }
}

